import logo from "./logo.svg";
import "./App.css";
import Account from "./component/Account";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <>
      <Router>
        <Routes>
          <Route to="/account" element={<Account />}></Route>
        </Routes>
      </Router>
    </>
  );
}

export default App;
